import React from 'react';
import '../css/mainPage.css';

function MainPage() {
  return (
    <div className="App">
      <div className="chat-history">
        {/* 聊天歷史會在這裡顯示 */}
      </div>
      <div className="text-input">
        <input type="text" />
      </div>
      <button className="submit-button">Send</button>
    </div>
  );
}

export default MainPage;
